import React from 'react';
import Navigation from './Navigation';
import './Header.css'; // Assuming you have some styles for the header

const Header = () => {
    return (
        <header>
            <h1>Marta Cuevas</h1>
            <h2>Ingeniera de la Salud</h2>
            <Navigation />
        </header>
    );
};

export default Header;
